INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(65775, 'zhTW', '單人戰略', '完成15回單人隨機戰鬥。', '你活過了戰鬥的考驗。\n\n不過，我覺得還是有進步的空間。再去試一次。\n\n結束後再回來找我。', '', '', '', '', '', '', 42488),
(65773, 'zhTW', '單人任務', '完成5回單人隨機戰鬥。', '是時候讓你獨自證明自己的本事了。\n\n有個機會可以延續衝突，但必須由你獨自來完成。有時候你得跟敵人一起戰鬥才能知己知彼。這似乎是個好機會。\n\n祝你好運。', '', '', '', '', '', '', 42488),
(65772, 'zhTW', '必要的物資', '在大草原和周邊的區域，從原鷹、原鹿和原狼身上收集$1oa份蛋白質。', '淵誓者的攻擊行動和你們的出現，讓我們的糧食供應出現短缺。我並不樂見如此，但最直接的解決辦法就是從周遭的野生動物徵集我們欠缺的資源。\n\n很遺憾事情變成這樣，但我們還是得這麼做。去獵殺一些野生動物，幫助我們補充糧食。', '', '', '', '', '', '', 42488),
(65771, 'zhTW', '首創者的眷顧', '在大草原四周點燃受啟迪者薰香。', '閻獄之主的手下對我們發動了攻擊，這是一個徵兆！過去，我們之中曾有人試圖追尋首創者的禁忌知識，因而招來首創者的憤怒，害我們失去原本擁有的保守。\n\n我們必須為同胞的僭越之舉贖罪。\n\n收下這個薰香。到草原上點燃它，為首創者獻上我們的懺悔，祈禱我等罪人能獲得他們的原諒。', '', '', '', '', '', '', 42488),
(65768, 'zhTW', '我們的前線斥候', '與澤瑞斯莫提斯的前線斥候交談。', '雖然閻獄之主的部隊掌控著澤瑞斯莫提斯絕大多數的地方，但他們並非唯一的威脅。\n\n我派出了斥候到週邊的地區巡邏，調查是否有其他的潛在威脅。\n\n去和每個斥候談談，聽取他們的調查結果。收集這些偵蒐情資，然後回來向我彙報。', '', '', '', '', '', '', 42488),
(65749, 'zhTW', '裝備的必要性', '收集法琳的研究筆記，把筆記交給拉弗克。', '我和我的同事拉弗克分享研究成果有一段時間了。唯有靠我們分享成果，他才能獲得有用的物品。\n\n把我的研究筆記交給拉弗克，看看你能不能讓他對你有好感。一旦時機成熟，他應該可以協助你取得更好的裝備。', '', '', '', '', '', '把法琳的研究交給朝聖者之澤的拉弗克。', 42488),
(65748, 'zhTW', '你做出了貢獻', '從澤瑞斯莫提斯的寶箱、儲藏箱、聖物以及其他容器中找到$1oa個受啟迪的補給品。', '我能提供裝備，是因為有首創者的祝福…和許多旅行者努力的成果。\n\n我們每個人都要為了後來的人做出貢獻。\n\n收集你在澤瑞斯莫提斯探索時找到的補給品。把眼睛放銳利一點…它們可能藏在奇怪的地方。把東西帶回來給我，我會把它們轉交給之後的旅行者。', '', '', '', '', '', '', 42488),
(65735, 'zhTW', '懸賞：卡司托斯', '消滅卡司托斯。', '有個原本穩定的自主機出現了不尋常的故障跡象，開始攻擊朝聖者之澤外面路上的受啟迪者。\n\n對我們的朝聖者而言，維持道路安全相當重要。\n\n拉弗克已經把殲滅此威脅列為最高優先等級。', '', '卡司托斯已經失控，會攻擊任何接近它的東西。', '卡司托斯', '', '', '通知朝聖者之澤的拉弗克你成功了。', 42488),
(65727, 'zhTW', '鑽地原蟾', '從澤瑞斯莫提斯附近的原蜂那裡取得$1oa份原蜂蜂蜜。', '你有停下腳步看過原蟾嗎？\n\n有個可愛的原蟾在水下，靜止不動又有耐心。有智慧的布德很像他，我感覺到布德很想好好看看這隻大原蟾。\n\n或許我們能用棲息在澤瑞斯莫提斯的原蜂所產的蜂蜜引牠出來。你能去收集一些嗎？', '', '', '', '', '', '', 42488),
(65726, 'zhTW', '鑽地原蟾', '', '', '', '', '', '', '', '', 42488),
(65725, 'zhTW', '鑽地原蟾', '', '', '', '', '', '', '', '', 42488),
(65717, 'zhTW', '重要動機', '把年鑒的回音帶去流亡者洞穴給法琳。', '<有個小東西吸引了你的目光。它閃耀著創先者的魔法，雖然古老，但卻異常精緻。>\n\n<這個裝置發出輕柔的震動和音調，不斷重複，簡直就像在…說話一樣？>\n\n<法琳對這東西一定會很有興趣。>', '', '', '', '', '', '在流亡者洞穴與法琳交談。', 42488),
(65674, 'zhTW', '這是什麼？', '把無形體精華帶去流亡者洞穴給法琳。', '<你手中的不明精華看起來可以用於許多用途。它簡直散發著無窮可能性。>\n\n<或許法琳能提供更多資訊。>', '', '', '', '', '', '在流亡者洞穴與法琳交談。', 42488),
(65625, 'zhTW', '閻獄之主的試煉', '進入托迦司大廳的新傳送門。', '淵喉行者！我找了你好久。\n\n據說閻獄之主有新的部隊正在托迦司集結。雖然我不清楚他們要做什麼，但肯定不是好事。\n\n也許你該去終結他們的計畫？', '', '', '', '', '', '', 42488),
(65517, 'zhTW', '企鵝靈魂', '將企鵝靈魂帶給森林之心的丘發。', '<企鵝靈魂活潑而且擅長與人相處，你之後能夠隨意呼喚企鵝的化身。>', '', '', '', '', '', '將企鵝靈魂帶給森林之心的丘發。', 42488),
(65516, 'zhTW', '綿羊靈魂', '將綿羊靈魂帶給森林之心的丘發。', '<綿羊靈魂冷靜而且堅強，你之後能夠隨意呼喚綿羊的化身。>', '', '', '', '', '', '將綿羊靈魂帶給森林之心的丘發。', 42488),
(65515, 'zhTW', '豬靈魂', '將豬靈魂帶給森林之心的丘發。', '<豬靈魂充滿好奇心而且個性頑強，你之後能夠隨意呼喚豬的化身。>', '', '', '', '', '', '將豬靈魂帶給森林之心的丘發。', 42488),
(65514, 'zhTW', '犰狳靈魂', '將犰狳靈魂帶給森林之心的丘發。', '<犰狳靈魂謹慎而且強韌，你之後能夠隨意呼喚犰狳的化身。>', '', '', '', '', '', '將犰狳靈魂帶給森林之心的丘發。', 42488),
(65513, 'zhTW', '哥羅米靈魂', '將哥羅米靈魂帶給森林之心的丘發。', '<哥羅米靈魂精力充沛而且充滿好奇心，你之後能夠隨意呼喚哥羅米的化身。>', '', '', '', '', '', '將哥羅米靈魂帶給森林之心的丘發。', 42488),
(65510, 'zhTW', '雷龍靈魂', '將雷龍靈魂帶給森林之心的莫恩女士。', '<雷龍靈魂忠誠而且英勇，你之後能夠隨意呼喚雷龍的化身。>', '', '', '', '', '', '將雷龍靈魂帶給森林之心的莫恩女士。', 42488),
(65509, 'zhTW', '蝙蝠靈魂', '將蝙蝠靈魂帶給森林之心的莫恩女士。', '<蝙蝠靈魂狡詐而且靈敏，你之後能夠隨意呼喚蝙蝠的化身。>', '', '', '', '', '', '將蝙蝠靈魂帶給森林之心的莫恩女士。', 42488),
(65508, 'zhTW', '陸行鳥靈魂', '將陸行鳥靈魂帶給森林之心的莫恩女士。', '<陸行鳥靈魂身手靈敏而且充滿好奇心，你之後能夠隨意呼喚陸行鳥的化身。>', '', '', '', '', '', '將陸行鳥靈魂帶給森林之心的莫恩女士。', 42488),
(65507, 'zhTW', '伊萊克靈魂', '將伊萊克靈魂帶給森林之心的莫恩女士。', '<伊萊克靈魂機靈而且強大，你之後能夠隨意呼喚伊萊克的化身。>', '', '', '', '', '', '將伊萊克靈魂帶給森林之心的莫恩女士。', 42488),
(65506, 'zhTW', '魟魚靈魂', '將魟魚靈魂帶給森林之心的莫恩女士。', '<魟魚靈魂機靈而且靈敏，你之後能夠隨意呼喚魟魚的化身。>', '', '', '', '', '', '將魟魚靈魂帶給森林之心的莫恩女士。', 42488),
(65505, 'zhTW', '毒蠍靈魂', '將毒蠍靈魂帶給森林之心的莫恩女士。', '<毒蠍靈魂兇猛而且饑渴，你之後能夠隨意呼喚毒蠍的化身。>', '', '', '', '', '', '將毒蠍靈魂帶給森林之心的莫恩女士。', 42488),
(65504, 'zhTW', '龍鷹靈魂', '將龍鷹靈魂帶給森林之心的莫恩女士。', '<龍鷹靈魂靈活而且強韌，你之後能夠隨意呼喚龍鷹的化身。>', '', '', '', '', '', '將龍鷹靈魂帶給森林之心的莫恩女士。', 42488),
(65466, 'zhTW', '你的第一個符古爾原鎖', '完成符古爾原鎖。', '為了協助我的研究，你需要能夠解讀各種不同的創先者暗語，包括符古爾原鎖。這是其中難度最高的暗語，我來為你示範該怎麼做。', '', '', '', '', '', '', 42488),
(65461, 'zhTW', '你的第一個梅索尼克原鎖', '完成梅索尼克原鎖。', '為了協助我的研究，你需要能夠解讀各種不同的創先者暗語，包括梅索尼克原鎖。好，我來為你示範該怎麼做。', '', '', '', '', '', '', 42488),
(65460, 'zhTW', '你的第一個肯塔瑞克原鎖', '完成肯塔瑞克原鎖。', '淵喉行者，看來波克波可已經學會了藏機語，因此你將可以存取造物操縱臺。你會在澤瑞斯莫提斯各地找到不同種類的操縱臺。\n\n為了協助我的研究，你需要能夠解讀各種不同的創先者暗語，包括肯塔瑞克原鎖。\n\n我來為你示範，你該怎樣幫助我。', '', '', '', '', '', '', 42488),
(65456, 'zhTW', '法琳的行囊', '協助法琳開啟通往澤瑞斯莫提斯的門。', '你的傳送門開啟的時候，我正在這邊收集資料，但是這陣干擾啟動了門鎖的機制。\n\n那麼請你把門的鑰匙收集回來，也是應該的吧？等你都辦好了，我們再來好好談談。', '', '', '', '', '', '', 42488),
(65432, 'zhTW', '進一步研究：中調語', '在流亡者洞穴進一步調查暗語控制臺。', '<蘊含神祕能量的控制臺發出嗡嗡聲響。>', '', '', '', '', '', '', 42488),
(65431, 'zhTW', '進一步研究：初調語', '在流亡者洞穴進一步調查暗語控制臺。', '淵喉行者，你有一些奇妙的發現，但依然有許多秘密等待發掘。\n\n你踏出了解開這座控制臺的第一步，相信你已經準備好進行下一步。\n\n請前往控制臺，看看它是否會對你揭曉新的東西。', '', '', '', '', '', '', 42488),
(65425, 'zhTW', '千變萬化的薩亞德', '在暴風城與拉菲卓司‧虛無之心交談，討論如何調整你的召喚魅魔法術。', '作為我的主人，你應該要知道，我其實懂得許多把戲，有辦法…滿足你的個人喜好。\n\n<惡魔對著自己比手勢>\n\n如果你不喜歡這個外貌，我也可以持續保持另一種你夢中所求的樣子。去和導師談談，應該能夠教你如何調整召喚儀式。\n\n不過，如果你想要交給我自己決定的話嘛…我也能夠保證無論如何你會很享受其中。', '', '', '', '', '', '', 42488),
(65424, 'zhTW', '千變萬化的薩亞德', '在奧格瑪與卡茲克‧暗嘯交談，討論如何調整你的召喚魅魔法術。', '作為我的主人，你應該要知道，我其實懂得許多把戲，有辦法…滿足你的個人喜好。\n\n<惡魔對著自己比手勢>\n\n如果你不喜歡這個外貌，我也可以持續保持另一種你夢中所求的樣子。去和導師談談，應該能夠教你如何調整召喚儀式。\n\n不過，如果你想要交給我自己決定的話嘛…我也能夠保證無論如何你會很享受其中。', '', '', '', '', '', '', 42488),
(65410, 'zhTW', '令人費解的狀況', '', '', '', '', '', '', '', '', 42488),
(65407, 'zhTW', '辨識藍圖', '', '', '', '', '', '', '', '', 42488),
(65406, 'zhTW', '連結在一起', '', '', '', '', '', '', '', '', 42488),
(65360, 'zhTW', '結構圖重新同化：原蛇威脅者', '把結構圖帶去合適的原靈體熔爐。', '<這個結構圖裡面記載著新原靈體造物的建造設計。把結構圖帶去合適的原靈體熔爐，說不定熔爐就能夠為你製作出裡頭記載的生物。>', '', '', '', '', '', '在澤瑞斯莫提斯，把結構圖帶去合適的原靈體熔爐。', 42488),
(65356, 'zhTW', 'Tracking Quest', '', '', '', '', '', '', '', '', 42488),
(65324, 'zhTW', '計畫中的計畫', '在澤瑞斯莫提斯完成世界任務、完成每日任務、搜刮寶藏和殺死稀有生物，以協助盟友。', '這裡是暗影之境的起源之地，絕對不能讓這裡也變成暗影之境的末路。\n\n$n，去找新的盟友合作吧。是否能夠獲得他們的協助將決定我們的成敗，也將決定世間萬物是否會就此灰飛煙滅。', '', '', '', '', '', '', 42488),
(65305, 'zhTW', '前進的道路', '到庇護城向大領主伯瓦爾‧弗塔根回報', '淵喉行者，看來你好像交到了新朋友呢！\n\n有波克波可在身旁，真期待你接下來還會在澤瑞斯莫提斯發現什麼樣的秘密！我們在這裡所發現的知識，將能協助我們對抗閻獄之主。說不定這樣的秘密還能夠引領我們喚醒這位神諭者。\n\n大領主伯瓦爾一定會想要知道這件事的。\n\n請前往庇護城通知他。洞穴外面就有一個傳送器，如果你想要的話可以使用。\n\n我會待在這裡負責照看神諭者。', '', '', '', '', '', '到庇護城與大領主伯瓦爾‧弗塔根交談。', 42488),
(65271, 'zhTW', '締結羈絆', '進入庇護城與對方的長者見面。', '法琳跟這些受啟迪的仲介者之間似乎存在歧異。不過話又說回來，他那個人看起來還挺…古怪的。\n\n總之呢，如果我們想要聯繫上奧睿博司的盟友並擊敗閻獄之主，就必須在澤瑞斯莫提斯這邊結識新的盟友。\n\n淵誓者似乎正在庇護城的門口外面集結。我們絕對不能再讓更多無辜之人落入閻獄之主的魔掌。\n\n希望受啟迪者願意接受我們的協助。朋友，你先請。', '', '', '', '', '', '', 42488),
(65262, 'zhTW', '拯救原基袋熊', '', '', '', '', '', '', '', '', 42488),
(65256, 'zhTW', '咯咯砰', '在大草原使用動能微生命校準器「重新校準」故障的原雞。', '澤瑞斯莫提斯的特有種原雞受到了那些入侵者的負面影響。\n\n對故障的原雞使用這個裝置。否則它們會對這片土地帶來巨大的傷害。', '', '', '', '', '', '', 42488),
(65234, 'zhTW', '甜蜜以對', '', '', '', '', '', '', '', '', 42488),
(65232, 'zhTW', '原基蠕蟲化', '', '', '', '', '', '', '', '', 42488),
(65230, 'zhTW', '機器植物', '', '', '', '', '', '', '', '', 42488),
(65177, 'zhTW', '綻放果實', '在滋長花園收集滋長瓜種子，並殺死蔓生的植物。', '在造物和能量所匯聚的洪流中，我們永遠也不曉得什麼時候會出現新的東西。\n\n滋長花園綻放出某種新的水果作物。這種作物的種子似乎擁有特殊屬性，我們想要了解其中的奧妙。\n\n請盡可能多收集一些種子過來，也讓花園的環境變得更加安全。', '', '', '', '', '', '', 42488),
(65152, 'zhTW', '堅強的羈絆', '', '', '', '', '', '', '', '', 42488),
(65149, 'zhTW', '勘測暗語', '找到澤瑞斯莫提斯的索引控制臺。', '澤瑞斯莫提斯的其他地方還有許多類似的控制臺。\n\n這些控制臺都超過我的理解能力，但說不定那個生物是想要帶領我們探索其中的奧妙？\n\n幸運的是，我知道哪裡還有。我會把它們標記在你的地圖上，並一路陪你同行…當然純粹為了研究目的。\n\n我們來看看這個生物到底想要做什麼吧。', '', '', '', '', '', '', 42488),
(65142, 'zhTW', '傳送門行動', '收集$3oa份窺探之眼的研究數據。', '為了要進行研究，我利用移動傳送門網路在澤瑞斯莫提斯的各個地方安裝了監控裝置。\n\n我的裝置順利收集到大量的研究數據。現在是時候去把裝置所收集到的數據取回來了。\n\n使用我的傳送門網路找到窺探之眼，並收集那些裝置裡面的數據。此外，我也會給你一個傳送門啟動器，讓你能夠重新進入傳送門網路，以免你找不到回來的路！', '', '', '', '', '', '', 42488),
(65102, 'zhTW', '魚的眼睛', '', '', '', '', '', '', '', '', 42488),
(65089, 'zhTW', '蛙蛙', '', '', '', '', '', '', '', '', 42488),
(65072, 'zhTW', '不安全的工作環境', '協助拉娜搜尋並收集$2oa個創先者文物。', '自從拉娜在悠恆裂片那邊發現創先者文物之後，受啟迪者就一直議論紛紛。這些文物比我們原先發現的還要更加古老，透過這些文物，我們說不定能夠更進一步地去瞭解澤瑞斯莫提斯的運作機制。\n\n拉娜正在收集文物，但我擔心她可能會遇到危險。我們在附近有發現希商集團密探的行蹤，對方很有可能是要來竊取文物的。\n\n請前往悠恆裂片，並協助拉娜收集文物。', '', '', '', '', '', '', 42488),
(65070, 'zhTW', '我能養他嗎？', '對艾爾尼灑水。', '喔不，我害這片神聖的土地變得混亂不堪。\n\n你看，艾爾尼跟你建立了羈絆。這令我感到難受，但跟我相比，你應該能夠把他照顧得更好。\n\n等我們解決這件事情之後，我建議你可以領養他。\n\n至少我們現在知道，瀑布擁有能夠改變生物大小的能力。我們再試一次。', '', '', '', '', '', '', 42488),
(65069, 'zhTW', '遏止漩渦', '殺死$1oa個艾爾尼複製體。', '那些艾爾尼複製體並不怎麼友善。\n\n次元瀑布的某種效果創造出了他們，但他們並不穩定。你有看見他們的去向嗎？\n\n我們必須趕快削減他們的數量，以免他們跑去傷害其他的野生動物。你去負責處理這件事情，我要去瀑布那邊再採集另一個樣本。', '', '', '', '', '', '', 42488),
(65068, 'zhTW', '洪流般的影響', '拿次元瀑布的水做實驗。', '次元瀑布這邊的許多生物似乎都受到了周遭環境的影響。嗯…我們拿瀑布本身來做實驗吧！\n\n澤瑞斯莫提斯這邊的許多自然組件都具有特殊效果，說不定水也是如此。\n\n取一點水過來，然後把水灑在瀑布那邊的生物身上，看看會發生什麼事！', '', '不曉得水具有什麼樣的效果呢？', '艾爾尼', '', '', '', 42488),
(65067, 'zhTW', '仲介者燒杯', '從次元瀑布附近的肉食原鹿那裡取回零件燒杯。', '在你還沒來這裡之前，我正在進行自己的實驗。\n\n那些實驗…進行得並不順利。沒想到周遭環境中的元素居然能會讓生物變得兇暴，導致最溫馴的生物都變成掠食者。\n\n我當時把裝著零件的容器丟下拔腿狂奔，現在卻記不得當時丟在哪裡了。\n\n燒杯肯定就在那群肉食原鹿所在位置。如果這些花朵無法奏效，我們會需要那個容器才有辦法進行下一個階段的實驗。', '', '', '', '', '', '', 42488),
(65066, 'zhTW', '植物的香氣', '在次元瀑布附近拿炫彩薔薇做實驗。', '或許我們應該先釐清效果，然後再拿艾爾尼做實驗。\n\n其他的薔薇先留著，我們應該多做點測試再說。相較之下，瀑布那邊的生物溫馴許多，更適合進行這類試驗。\n\n我們來看看不同的生物對於薔薇的香氣是否也會有不同的反應。', '', '', '', '', '', '', 42488),
(65064, 'zhTW', '看看我找到了誰！', '在次元瀑布附近取得$2oa朵炫彩薔薇。', '你看這生物多麼神奇！\n\n希洛說我們已經沒有足夠的資源可以再養一隻「不尋常的寵物」了。\n\n但或許有個方法能夠改造艾爾尼，讓我可以收留它。這裡的生物和周遭環境有一種奇妙的互動方式。我們說不定能夠讓他的體型變小。\n\n我知道有個地方可供我們進行研究。附近有炫彩薔薇，這種植物可能可以觸發我需要的反應，你能夠幫忙收集一點過來嗎？', '', '', '', '', '', '', 42488),
(65024, 'zhTW', '雲蛟靈魂', '將雲蛟靈魂帶給森林之心的莫恩女士。', '<雲蛟靈魂有活力又忠誠。你將來能任意化身為雲蛟之形態。>', '', '', '', '', '', '將雲蛟靈魂帶給森林之心的莫恩女士。', 42488),
(65023, 'zhTW', '蟄猛巨蟲靈魂', '將蟄猛巨蟲靈魂帶給森林之心的莫恩女士。', '<蟄猛巨蟲靈魂兇猛又堅決。你將來能任意化身為蟄猛巨蟲之形態。>', '', '', '', '', '', '將蟄猛巨蟲靈魂帶給森林之心的莫恩女士。', 42488),
(64974, 'zhTW', '清理自主機', '', '', '', '', '', '', '', '', 42488),
(64958, 'zhTW', '集結成軍', '在澤瑞斯莫提斯與克瑞斯長老交談', '你在前往澤瑞斯莫提斯的旅途中沒有遇到大礙，真是太好了。我聽到佩拉苟斯和克蕾雅的談話內容，看樣子你們這趟旅程很精彩。\n\n這些受啟迪的仲介者說不定能夠成為我們寶貴的盟友。他們對於自主機以及土地的了解，應該都能夠幫助我們對抗閻獄之主。\n\n我們的部隊已經集結完畢，隨時都能跟你一起前往澤瑞斯莫提斯。\n\n$p，最後一場戰鬥即將開打。', '', '', '', '', '', '', 42488),
(64957, 'zhTW', '古老的甬道石', '開啟通往奧睿博司的甬道石。', '閻獄之主撤回了他的大軍。我應該要鬆一口氣才對，但我擔心他是已經找到了進入聖塚的通道。\n\n<亞拉長老渾身發抖。>\n\n雖然克瑞斯長老對你懷有疑慮，但你證明了自己確實是位盟友。我們需要更多像你這樣的人。\n\n我們這支遠征隊起初來到澤瑞斯莫提斯的時候，發現了一個休眠的甬道石。如果你真的是淵喉行者，那麼根據預言所說，你應該能夠啟動那個甬道石。\n\n如果你的盟友能夠拯救這片神聖的土地，那麼必須為他們打開通到。\n\n來吧。', '', '', '', '', '', '與大領主伯瓦爾‧弗塔根交談。', 42488),
(64953, 'zhTW', '捍衛庇護城', '在大草原擊敗$1oa個淵誓者。', '淵誓者在我們的大門口外面集結成軍。看樣子他們是鐵了心想要佔領我們的家園！\n\n受啟迪者只不過是想要靜靜地讚嘆首創者的奇觀。庇護城防護屏障的用途是保護我們免受小型威脅的侵擾。但我們沒想到閻獄之主會派大軍來攻打我們。\n\n凡人，你說你是我們的盟友對吧？那就協助我們捍衛這片神聖的土地吧。', '', '', '', '', '', '', 42488),
(64952, 'zhTW', '摧毀摧毀者', '摧毀$1oa個淵喉摧毀者。', '淵誓者擁有可怕的武器，能夠匯聚黑暗魔法攻擊大門。\n\n庇護城周遭的防護屏障就快要撐不住了。我們所建造的一切、所珍視的一切，很快都會化為烏有。\n\n如果你真的那麼厲害，那就證明給我們看吧。摧毀敵人的武裝，協助我們捍衛家園。\n\n願首創者保佑你旗開得勝。', '', '', '', '', '', '', 42488),
(64951, 'zhTW', '前往庇護城的道路', '跟法琳一起離開創始存放庫。', '我原先並沒有料到今天會遇到活生生的凡人和琪瑞安，不過你們所提供的協助對我來說相當重要。\n\n在我開始研究這個自主機核心之前，我會引導你們前往庇護城，也就是我的遠征隊在抵達此處之後所設置的據點。\n\n雖然我因為質疑同胞的「啟迪」教義而遭到流放，但我還是不希望閻獄之主毀了庇護城。\n\n如果你願意幫助他們，他們說不定也會協助你回到盟友身邊。畢竟我們這些仲介者最講究的就是利益交換。', '', '', '', '', '', '', 42488),
(64950, 'zhTW', '雙向交流', '使用自主機的手啟動自主機控制臺，並獲得存放庫的寶藏。', '看樣子其它的自主機很不滿我們占用它們同胞的手。它們對我們有了敵意。\n\n真糟糕，不過我們不能因為這樣就停下腳步。\n\n自主機的手應該能夠啟動創始存放庫裡面的控制臺。我認為那個儲物庫裡面藏有威力強大的物品。\n\n拿到東西之後，我會引導你前往另一個地方，這樣你說不定就能聯絡上那些沒有跟你一起過來的盟友了。\n\n就這樣說定囉？', '', '', '', '', '', '', 42488),
(64949, 'zhTW', '研究用途', '從創始之廳的警戒自主機身上收集$1oa個完好的自主機碎片。', '我在澤瑞斯莫提斯的這段時間，很努力地盡量不去打擾到自主機。到目前為止，它們也都幾乎都無視我的存在。\n\n看樣子最近發生的事情改變了這一點。\n\n我想再次強調，我並不想傷害首創者的造物。如果你在執行任務的過程中不得不與自主機交戰，那我們至少得確保自主機不會白白犧牲。\n\n如果我有機會研究死去自主機的碎片，說不定能夠從中找到方法來對抗淵誓者。\n\n請務必小心謹慎。', '', '', '', '', '', '', 42488),
(64947, 'zhTW', '助我一臂之力', '協助法琳。', '如果要把閻獄之主逐出澤瑞斯莫提斯，我們就必須動用所有的資源來對抗敵人。\n\n附近的存放庫那邊有個蘊藏力量的物體，但是存放庫的防禦機制只聽自主機使喚。我不願意傷害自主機，但我有找到一個故障的自主機。\n\n如果你能夠把它的手取下來，我們就可以利用那個沒有作用的肢體來進入存放庫。\n\n把首創者的造物拿來作為這種用途實在不是很妥當，不過我們絕不能坐視淵誓者在這個界域撒野。', '', '', '', '', '', '', 42488),
(64945, 'zhTW', '奇妙土地的陌客', '跟佩拉苟斯一起探索周遭環境。', '我們…抵達澤瑞斯莫提斯了嗎？然後，我們是行走在水面上嗎？\n\n這個地方真是太奇妙了！雖然隔著迷霧看得不是很清楚，但還是很奇妙。\n\n我依稀看見遠處有某種建築。說不定在那裡能夠找到答案。', '', '', '', '', '', '', 42488),
(64944, 'zhTW', '倉促啟程', '騎上靈魄龍鰻，展開前往澤瑞斯莫提斯的旅程。', '通往澤瑞斯莫提斯的通道開啟了。\n\n我們必須在這裡分道揚鑣。永恆者禁止回到自己被創造的地方。佐瓦爾違背了創先者最神聖的定律。\n\n你必須獨自一人面對這場旅程。\n\n去吧。在澤瑞斯莫提斯建立據點，這樣我們才能派遣誓盟的部隊過去。\n\n然後，我們會追擊閻獄之主，並終結他的瘋狂。', '', '', '', '', '', '', 42488),
(64942, 'zhTW', '統御者的呼喚', '與奧睿博司的塔因納拉交談，前往審斷者殿堂。', '雖然我們在統御聖所奮戰，努力想要阻止閻獄之主，但還是失敗了。他把奧睿博司吸入淵喉之中、擊倒了審斷者，並開啟通往澤瑞斯莫提斯的通道。\n\n我們必須追上去。\n\n在審斷者殿堂中，我們將鑄造出屬於自己的道路。\n\n淵喉行者，快。暗影之境以及其他所有世界的命運都危在旦夕。', '', '', '', '', '', '與統御者交談。', 42488),
(64867, 'zhTW', '受啟迪者的補給品', '在澤瑞斯莫提斯地庇護城與威洛交談。', '啊，有了。我期待這一刻已經有好一段時間了！\n\n來拜訪我吧。我們一起分享這份成就。\n\n我替你精心準備了某樣東西。', '', '', '', '', '', '', 42488),
(64861, 'zhTW', '天命圓盤', '將物品送去給法琳。', '<法琳應該用得上這個。>', '', '', '', '', '', '', 42488),
(64860, 'zhTW', '乙太晶格', '將物品送去給法琳。', '<法琳應該用得上這個。>', '', '', '', '', '', '', 42488),
(64852, 'zhTW', '永世矩陣', '將物品送去給法琳。', '<法琳應該用得上這個。>', '', '', '', '', '', '', 42488),
(64825, 'zhTW', '尋求庇護', '跟著珍娜和貝恩一起回到庇護城。', '我感到迷惘。\n\n我們沒辦法追擊佐瓦爾和安杜因。我會開啟傳送門回到庇護城，到時再討論下一步的計畫。', '', '', '', '', '', '', 42488),
(64824, 'zhTW', '為熔爐而戰', '跟珍娜一起前往來世熔爐。', '我們已經盡全速趕來這個地方了。有人看見安杜因出現在這片土地正中央的建物附近，叫做來世熔爐的地方。\n\n想必閻獄之主很快也會過去他的身邊。我們必須立刻啟程離開。', '', '', '', '', '', '', 42488),
(64823, 'zhTW', '分身決鬥', '在思緒之環找到淵誓者。', '這件事情我總感覺不大對勁。根據你回報的狀況看來，似乎是我們內部有人在蓄意搞破壞…或者是又有驚懼領主在作怪。\n\n假如跟驚懼領主有關，那麼方尖碑就有危險！快點過去，要是不趕緊採取行動，可能就會為時已晚！', '', '', '', '', '', '', 42488),
(64822, 'zhTW', '溝通中斷', '重新下達命令給三位誓盟指揮官。', '莫格萊尼跟我們討救兵的行為很反常。我們原本就有計畫要增派援軍，已經送去三支部隊了。\n\n這樣聽起來，部隊都沒有順利抵達。去看看你能否找到部隊指揮官，務必確保援軍能夠順利抵達莫格萊尼那邊。', '', '', '', '', '', '', 42488),
(64821, 'zhTW', '萬物皆虛假', '找到並殺死$oa個驚懼領主破壞者。', '這些驚懼領主能夠偽裝成任何事物…就連澤瑞斯莫提斯的居民也不例外，這可不好對付。幸運的是，我們有辦法能夠驅散他們的幻象。\n\n搜索附近的區域，並測試自主機。如果發現驚懼領主的蹤影，就把對方解決掉。', '', '', '', '', '', '', 42488),
(64820, 'zhTW', '自己的錯自己負責善後', '修理$oa個防禦節點。', '動物供應區通常由自動化傀儡負責照顧，但據說它們停止運作了。\n\n根據報告指出，就是因為你隨意干擾這些節點，才導致發生這個問題。也就是說，你要負責把它們修復好。拿著這個調諧器，它應該能夠派上用場。把東西修好之後，就不要再胡亂干擾它們了。', '', '', '', '', '', '', 42488),
(64818, 'zhTW', '可能需要增援部隊', '到庇護城與伯瓦爾‧弗塔根交談。', '沒想到驚懼領主已經潛入了我們的陣營。我們必須告訴伯瓦爾發生了什麼事。\n\n我不能離開我在這裡的崗位。快，去把消息告訴他。或許受啟迪者的議會也會知道點什麼。', '', '', '', '', '', '', 42488),
(64817, 'zhTW', '大隱隱於市', '保護植物供應區的方尖碑。', '那個聲音！是從植物供應區的方尖碑那裡傳過來的！\n\n這不可能，還沒有任何敵人突破防線才對！快點，$n！跟我來！', '', '', '', '', '', '', 42488),
(64815, 'zhTW', '我等共騎', '幫助$oa個誓盟部隊的士兵。', '四大誓盟跟此地的自主機一起合作。\n\n不幸的是，我們其中一部分的士兵走散了，又或者是身負重傷，無法回到這個地方來。\n\n如果你能夠協助他們，將能幫上很大的忙。', '', '', '', '', '', '', 42488),
(64814, 'zhTW', '熔爐之戰', '殺死$oa個淵誓者。', '我方部隊到目前為止都還撐得住，但我們還不算是真正鞏固這個區域。我們需要你協助削減敵軍的數量。\n\n淵喉行者，這對你來說應該不難吧？', '', '', '', '', '', '', 42488),
(64797, 'zhTW', '秩序與混亂', '在地土供應區與達瑞安‧莫格萊尼交談。', '那些方尖碑一定是佐瓦爾陰謀詭計的關鍵。雖然我們還不完全理解其用途，但我認為阻止淵誓者使用方尖碑對我們一定有好處。\n\n我會把這個訊息傳達給大領主伯瓦爾。你們去跟達瑞安‧莫格萊尼說。他得針對這個消息規劃防禦工事。', '', '', '', '', '', '', 42488),
(64796, 'zhTW', '掃蕩沙地', '跟著珊蒂斯‧羽月一起偵察地層供應區。', '我到目前為止的偵查，幾乎沒有得到關於敵人的有用資訊。我們必須更靠近一點看看。\n\n只要你一聲令下，我就能讓我們兩個隱形。但是請不要靠近驚懼領主，他們的視覺很敏銳，就連隱藏行蹤的獵人也逃不過他們的法眼。', '', '', '', '', '', '', 42488),
(64794, 'zhTW', '知己知彼、百戰不殆', '在地層供應區附近與珊蒂斯碰面。', '$n，你應該跟珊蒂斯一起從東側潛入淵誓者的部隊之中。你們兩個發現的資訊，能夠協助我們規劃下一步的行動。\n\n保重。我們不曉得你們到時候會遇到什麼狀況。', '', '', '', '', '', '', 42488),
(64785, 'zhTW', '蔓生故事', '檢查大型地質元素和$3oa個地質元素，以獲得研究數據。', '自從我們來到這裡之後，原翠荒野一直都還是個未解之謎。這個區域的蓊鬱植被肆意生長蔓延，生物則是像無頭蒼蠅一樣到處亂竄。\n\n我們說不定能夠從這些生物身上取得寶貴的研究數據。\n\n使用拘捕陷阱制伏元素生物。成功制伏之後，在從對方身上採集研究數據。', '', '', '', '', '', '', 42488),
(64771, 'zhTW', '受啟迪者的遠征', '與庇護城各處的受啟迪者交談。', '你好，我的朋友！\n\n亞商集團很久以前曾經派出遠征隊前來搜索這個區域，但卻失蹤了。我來到澤瑞斯莫提斯，就是希望能夠拯救走散的集團成員不受淵喉威脅的荼毒。\n\n而我終於找到我的老朋友了！但是，她卻不願意回到安全的地方。\n\n說不定其他人能被說服。你能夠幫我試試看嗎？', '', '', '', '', '', '', 42488),
(64760, 'zhTW', '技術障礙', '在沉眠寶庫按下控制臺的按鈕。', '這個控制臺故障了！我們必須修好它！\n\n說不定這些按鈕能有什麼功用？', '', '', '', '', '', '', 42488),
(64758, 'zhTW', '跟隨領袖', '調查沉眠寶庫。', '我們剛剛抵達的時候，封閉了通往沉眠寶庫的大門。那是個聖所、是此地所有珍貴造物的搖籃。我們不應該去干涉沉睡在裡頭的力量。\n\n如果說希商集團的領袖在我們分神欣賞此地之美的時候趁機突破護盾，那麼只怕他們已經造成了不小的損害。\n\n動作快！我們必須前往沉眠寶庫，並確保那個地方的安全。', '', '', '', '', '', '', 42488),
(64744, 'zhTW', '揪出隱身的仲介者', '在庇護城外面殺死$1oa個希商集團密探。', '你有沒有感覺到這裡的氣氛有異。希商集團雖然躲了起來，但他們就在附近。\n\n幸運的是，我很熟悉他們用來隱身的裝置。來，你拿著這個東西。把它放在地面上，它就能夠幫你找到隱藏在附近的敵人…但只是暫時的。\n\n阻止他們，就算必須得取對方性命也沒關係。', '', '', '', '', '', '', 42488),
(64743, 'zhTW', '是希商集團幹的好事嗎？', '收集$1oa張可疑的紙張。', '雖然看不見對方，但我很確定這裡就是希商集團建立據點的地方。\n\n希商集團之所以會來到澤瑞斯莫提斯的這個地方，肯定是受到什麼東西所吸引。我們必須釐清其中的原因，才有辦法保護我們的朋友。\n\n他們的隱形科技並沒有辦法妥善隱藏他們的補給品。去看看你能夠透過他們的私人物品發現什麼情報吧。', '', '', '', '', '', '', 42488),
(64742, 'zhTW', '犯罪證據', '找到希商集團來過的線索。', '看樣子護盾遭到人為破壞。不出所料，殘暴無情的希商集團果然是最先企圖要剝削這片土地的人。\n\n他們的貪婪導致原本就危急的局勢更加惡化。我們必須阻止他們。我們一起四處搜索一下，看能不能找到他們的足跡。', '', '', '', '', '', '', 42488),
(64741, 'zhTW', '安全檢查', '調查並強化庇護城周圍的護盾導管。', '我無法理解，他們可是我的同胞啊！希商集團和淵喉的爪牙都已經來到跟前了，他們怎麼還能如此冷漠？\n\n而且他們的防護技術已經過時，沒辦法把危險拒於門外。就算我無法說服他們離開，至少我必須確保他們能安全地繼續待著。\n\n我不想再次失去朋友。\n\n在護盾周圍應該會有四個隱藏的導體。拿上這個工具。這可以協助你檢視並強化那些裝置。', '', '', '', '', '', '', 42488),
(64717, 'zhTW', '造物材料', '收集$1oa個幻象碎片和$2oa個小型神秘粒子。', '散落在澤瑞斯莫提斯各處的大型金屬球體是已經退役的熔爐，是在造物過程中廢棄的。\n\n位於來世熔爐附近的球體蘊藏著微量的獨特材料，只有那個地方有。\n\n我改造了核心偵測器，讓它能夠採集那些材料。在我指定的熔爐附近使用。最巨大的創先者熔爐有比較高的機會找到稀有的幻象粒子。', '', '', '', '', '', '', 42488),
(64230, 'zhTW', '首創者的暗語', '調查暗語控制臺。', '前方的道路尚未明朗，但我們總算是邁出了第一步。\n\n看樣子這個神聖造物比起我更喜歡你。\n\n既然它已經為你展開認知的大門，就繼續看看它還想要向你展示什麼吧。\n\n學習的結果應該能夠啟迪你的心智。', '', '', '', '', '', '', 42488),
(64228, 'zhTW', '輪到你說話了', '跟法琳討論神諭者的事情。', '你真的帶了個神諭者過來！而且居然狀態完整！\n\n我從沒聽說過這些神聖的生命體居然會跟自主機以外的人對話。她能夠帶領我們了解澤瑞斯莫提斯的許多事物。\n\n我需要你把你知道的一切都告訴我！', '', '', '', '', '', '', 42488),
(64227, 'zhTW', '看不見的敵人', '殺死流亡者洞穴附近的刺客。', '自從你開啟從奧睿博司過來的通道之後，已經有好幾個集團趁機入侵，跑過來想要搶走我的研究成果…並且置我於死地。他們知道我的研究對於整體大局的重要性。\n\n接下來勢必還會有更多的刺客出現，誰叫你要大張旗鼓地跑到我這裡來！\n\n我沒辦法對付那麼多刺客。你必須收拾你闖下的禍，並協助我保護我的研究秘密。\n\n幫我解決那些刺客吧。', '', '', '', '', '', '', 42488),
(64226, 'zhTW', '安全措施', '使用感應同步裝置，在流亡者洞穴附近重新啟動$2oa個被觸發的陷阱。', '看樣子我在洞窟附近偷偷設置的陷阱並沒有我預期中的那麼有用，畢竟你還是出現在我家中了。\n\n不過，他們還是能夠協助我排除許多不速之客。\n\n因為你把刺客引到這裡來的關係，我沒辦法自己去重新啟動那些陷阱。\n\n這件事情必須要由你來處理，我則負責待在這裡，保護我自己還有我辛苦研究的心血結晶。去使用我放在附近的感應同步裝置，它會告訴你有哪些陷阱需要重新啟動。', '', '', '', '', '', '', 42488),
(64225, 'zhTW', '尋找法琳', '找到法琳。', '你有發現了嗎？真好運！能夠讓我看看信件的內容嗎？\n\n有個受啟迪者名叫瑟非斯，聽說法琳最後出現的地點位在死後世界熔爐的西側，跑去那邊尋找他了。\n\n我們應該從那邊開始搜索。', '', '', '', '', '', '', 42488),
(64224, 'zhTW', '尋找未知', '在庇護城打聽法琳的消息。', '如果長老不願意幫助我們，我們就只能另尋他人的協助。\n\n另一位受啟迪者法琳對於自主機很感興趣。\n\n他說自己跟同胞關係破裂。但庇護城肯定有人知道他的下落。\n\n四處打聽看看有沒有線索能夠引領我們找到法琳。我再去跟長老溝通，看能不能獲得一些情報。', '', '', '', '', '', '', 42488),
(64223, 'zhTW', '事情的核心', '在庇護城與克瑞斯長老交談', '她雖然倒下了，但似乎還活著。我們應該能做點什麼來幫助她。\n\n我們去問問看受啟迪者是否知道點什麼。我找個方法把她帶回去庇護城跟你碰面。', '', '', '', '', '', '', 42488),
(64219, 'zhTW', '神秘的聲音', '進入始源搖籃。', '這裡被破壞得真嚴重。吞噬者是不會善罷甘休的。\n\n希望那個發出聲音的個體沒有受很重的傷。\n\n這扇門沒辦法正常開啟。或許我們可以合力強行闖入！\n\n我不曉得門的後面有什麼，但對方需要我們的幫助。', '', '', '', '', '', '', 42488),
(64218, 'zhTW', '遠近都有危險', '調查創始原野。', '朋友，有關閻獄之主的事情，我們目前能做的已經都做了。\n\n還有其他事情需要我們去處理。比方說我最近在東邊的區域有看見吞噬者裂隙！\n\n如果不阻止那些怪物，它們就會在這個地方製造混亂。\n\n$n，你能協助我處理掉它們嗎？', '', '', '', '', '', '', 42488),
(64016, 'zhTW', '有個性的軟泥怪', '在重擊者瞰台協助黏黏測試對晶皮的生長能力。', '學徒！你跑哪裡去了？我到處在找你。\n\n凱文在我們的實驗中幫了大忙，我想要訓練其他的軟泥怪一起幫忙！\n\n至於黏黏的部分，我想要知道它有沒有辦法吞噬有機材料，然後讓自己的體型變大。', '', '', '', '', '', '', 42488),
(63952, 'zhTW', '重拳出擊', '殺死$1oa個淵誓破魂者、$2oa個結晶守護者、納莉絲女士和玻璃製造者。', '我們需要製造更多傀儡送往前線，但是目前手上沒有身體、頭部或腿部零件！\n\n拉桑正在製作傀儡，有可能比我們過去的作品還棒…裝了許多條手臂。\n\n什麼都別問！\n\n卡西斯那邊有敵人等我們去消滅，帶著手臂過去大開殺戒吧！', '', '', '', '', '', '到持續增長的黑暗上方的橋找藩侯辛丹。', 42488),
(63850, 'zhTW', '追蹤 - 小型控制臺', '', '', '', '', '', '', '', '', 42488),
(63609, 'zhTW', '科多獸靈魂', '將科多獸靈魂帶給森林之心的莫恩女士。', '<科多獸靈魂沉靜又忠實。你將來能任意化身為科多獸之形態。>', '', '', '', '', '', '將科多獸靈魂帶給森林之心的莫恩女士。', 42488),
(62089, 'zhTW', 'Professions - Reuse', '將記憶帶回去給符刻師。', '你發現的東西似乎是某種記憶。也許是符刻師的另一個失竊記憶。', '', '', '', '', '', '', 42488),
(61609, 'zhTW', '工程學：覆骨木樁發射器', '', '', '', '', '', '', '', '', 42488),
(56903, 'zhTW', '勇氣之冠', '從永歌森林、辛特蘭和莫高雷收集花朵。', '我看得出你對粉紅色花朵有所偏好。很可惜的是，編成花環的花遲早會凋謝。\n\n或許我能幫得上忙。\n\n雖然這些只是普通的花朵，我知道有一種類似的花，只在新年慶典綻放。如果你能幫我取回這些花，我可以為它們灌注伊露恩的力量，讓你能整年享受它們的美麗。', '', '', '', '', '', '回到月光林地去找麥蕊兒‧月綻。', 42488),
(54804, 'zhTW', '格樂戈', '', '', '', '', '', '', '', '', 42488),
(54349, 'zhTW', '黑海岸捐獻：潮沫亞麻布繃帶', '', '', '', '', '', '', '', '', 42488),
(54340, 'zhTW', '黑海岸捐獻：附魔戒指 - 加速之印', '', '', '', '', '', '', '', '', 42488),
(54338, 'zhTW', '黑海岸捐獻：熱能加速瘟疫散佈器', '', '', '', '', '', '', '', '', 42488),
(54331, 'zhTW', '黑海岸捐獻：冬吻花', '', '', '', '', '', '', '', '', 42488),
(54182, 'zhTW', '污水重擊兄弟', '', '', '', '', '', '', '', '', 42488),
(53617, 'zhTW', '大發慈悲', '殺死$1oa隻狂暴黑木熊怪。', '部落大肆破壞林地，把森林裡的孩子逼瘋了。\n\n最嚴重的是黑木熊怪。他們已經完全瘋狂，威脅到所有人的安全。如果放任不管，我們對抗部落時，甚至有可能遭受黑木熊怪攻擊。\n\n雖然這種要求令我痛苦，但拜託你在暮光谷時，順便讓熊怪脫離痛苦吧，別讓他們傷害其他人。', '', '', '', '', '', '跟德拉茵‧夏月隊長在古樹之林附近見面。', 42488),
(53312, 'zhTW', '光潔的白金', '', '', '', '', '', '', '', '', 42488),
(53264, 'zhTW', '阿拉希捐獻：無盡之海鯰魚', '', '', '', '', '', '', '', '', 42488),
(53261, 'zhTW', '阿拉希捐獻：霜覆火藥', '', '', '', '', '', '', '', '', 42488),
(53252, 'zhTW', '阿拉希捐獻：智力戰爭卷軸', '', '', '', '', '', '', '', '', 42488),
