(52897, 'zhTW', '我們會「搖」你', '', '', '', '', '', '', '', '', 42488),
(52234, 'zhTW', '藏身樹影間', '找到$1oa名隱藏起來的利爪德魯伊。', '我已盡了全力阻止部落入侵，但目前無法得知有多少部隊已抵達此地。這些幽光能阻礙部落，但無法完全抵擋他們攻擊。\n\n<瑪法里恩豎起耳朵。>\n\n英雄，你聽到了嗎？古樹在向我們呼喚！\n\n$n，我們無論如何都一定要保護古樹！他們能看見我們看不見的東西，能聽到我們聽不到的聲音。\n\n我在暮光谷派了德魯伊駐守。去找他們。請他們前往古樹之林，我會增援這道牆。', '', '', '', '', '', '在古樹之林附近跟德拉茵‧夏月隊長見面。', 42488),
(52062, 'zhTW', '梣谷的混亂', '到阿斯特蘭納向德拉茵‧夏月隊長報到。', '該死的部落！我只能說，聰明的混帳。他們在貧瘠之地北邊的叉路轉向，現在正在朝梣谷方向進軍！\n\n卡多雷部隊已經朝著希利蘇斯出航－現在已經航行到半途。他們只剩下達納蘇斯城市守衛固守這個區域，他們已經動身前往阿斯特蘭納，但是要對抗一整支大軍，肯定撐不了多久。他們的指揮官名叫德拉茵‧夏月。\n\n找到她，$n，幫我們爭取時間。我們會盡快派出艦隊。', '', '', '', '', '', '', 42488),
