(36700, 'zhTW', '血之競技場的挑戰', '在血之競技場進行戰鬥。', '有人在血之競技場下了挑戰書。\n\n邀請戰友，為證明你勇士的地位而戰。', '', '', '', '', '', '', 42488),
(36687, 'zhTW', '血之競技場的挑戰', '在血之競技場進行戰鬥。', '有人在血之競技場下了挑戰書。\n\n邀請戰友，為證明你勇士的地位而戰。', '', '', '', '', '', '', 42488),
(32390, 'zhTW', '狼王的呼嗥', '與怒西昂談話。', '透過你的雙眼，$C，我見證了此地沿岸的慘烈戰事，以及世界各地的大規模對戰。你非常有耐心... 而且消息靈通。$b$b告訴你，我一直在密切觀察你們的國王。你有沒有興趣聽聽我發現了什麼呢?', '', '', '', '', '', '', 42488),
(27060, 'zhTW', '不潔之牛', '護送安杜因·烏瑞恩，從農夫沃勒頓的農場開始順著血的痕跡追查到犯罪現場。保護安杜因的性命。如果他不和你在一起，就會在暴風要塞等你。', '<農夫沃勒頓試著讓自己鎮定下來。>$B$B乳牛?你在詢問關於失蹤家畜的事?$B$B我通常讓乳牛們在這房子的北邊吃草。但有時候會被偷走一隻並留下一條血的痕跡。誰會做這種事情?$B$B我害怕自己去跟隨那道血跡...某種不對勁的事情正在暴風城中發生!', '', '', '', '', '', '', 42488),
(14409, 'zhTW', '謹慎的回歸', '將達洛斯的日誌交給達納蘇斯的摩丹特·平影。', '暫且留步，$c。$b$b改變的時刻即將來臨了。這迫使我們步出了埃德薩拉斯廢墟，再次與廣大的世界有所接觸。我前來研究這座城市而暫時無法離開，但你不同，因此我有件差事想麻煩你。$b$b我的夥伴前來達納蘇斯與他們的高階女祭司交談，或許我們能達成某種共識。請將這本日誌交給神殿內的摩丹特·平影。這會對他的外交任務有所幫助。', '', '', '', '', '', '', 42488),
(13932, 'zhTW', '又過了一年，又一個紀念品。', '把啤酒節酒杯兌換券交給啤酒節營地的貝爾碧‧迅移。', '啤酒節除了競速山羊外，還要痛快暢飲!有空的時候，拿這個兌換券去找貝爾碧‧迅移。她就在啤酒節營地後方附近。如果你找不到她，別擔心，她一定會看見你的。$b$b總之，把這張兌換券交給她來換取你的免費啤酒節酒杯。她也會樂意的為你處理各種啤酒節的交易。', '', '', '', '', '', '', 42488),
(13383, 'zhTW', '基羅赫茲', '首席工程師栓鉗要你前往「荒寂之門」奧多薩的聯盟秘密機場找到碁伯里·基羅赫茲。', '哥布林運氣好才發現了那個新的能源。他們稱作「綠外線」，要是他們沒拿來發個綠財，鬼才信。$B$B去找碁伯里·基羅赫茲，他帶了群逆向工程師在那邊研究綠外線，那是一個不大的聯盟機場，就在「荒寂之門」奧多薩上空。我會給你綠外線視覺幫助你找到那兒。找找我們的聯盟旌旗 -- 萬一你飛太靠近部落的機場，大概免不了惹上些綠色麻煩。', '', '', '', '', '', '', 42488),
(11454, 'zhTW', '尋找破壞者', '在黑石深淵的黑鐵酒吧中找到寇仁‧恐酒。', '這一堆破爛的廢紙像是被那些黑鐵入侵者所意外留下來的。$B$B那些計畫很複雜，而且是用一種矮人語密碼所寫成，末尾的簽名『寇仁‧恐酒』倒是很清楚，還提到提到黑石深淵的黑鐵酒吧。你應該要找到這個教唆者，終止這些掠奪。', '', '', '', '', '', '', 42488),
(10605, 'zhTW', '凱倫丁的召喚', '跟幽暗城的凱倫丁·哈加爾談話。', '你的臉上有種渴望學習的表情，$n。也許是時候可以加強你的訓練了。$b$b去跟幽暗城的凱倫丁·哈加爾談一談吧，這個老傢伙倒還懂得一兩手絕活你將來可能會派上用場。', '', '', '', '', '', '', 42488),
(9489, 'zhTW', '淨化斷崖', '對死亡之痕的6個永歌森林遊俠施放真言術:韌。', '$n，你在這裡真好。天譴軍團帶著無盡的恨意攻擊我們的城市，我擔心我們守衛的士氣就要被擊破了。$b$b快點前往南方的死亡之痕，潔拉和她的遊俠已經在那裡準備好了。用你的祝福讓他們充滿聖光的力量。', '', '', '', '', '', '', 42488),
(9189, 'zhTW', '送貨到瑟伯切爾', '將密封的辛多雷命令送到銀松森林的瑟伯切爾給諫言者索利安。', '你已經傷了這位小姐的心，雖然它早已不再跳動了。$B$B既然這樣，我有一封信要送到銀松森林的瑟伯切爾。諫言者索利安是我們在被遺忘者那邊的代表。$B$B最近的路線，除非你要坐他們的蝙蝠去，不然你就是從幽暗城的門口順著往南方的路走。跟著路標走。要到達目的地應該不困難。儘管放開你的心胸吧;瑟伯切爾可是一個殘破不堪的地窖呢。$B$B這些被遺忘者還真是奇怪的生物呢。', '', '', '', '', '', '', 42488),
(7261, 'zhTW', '國王的命令', '到希爾斯布萊德丘陵地區的奧特蘭克山谷去。到那裡之後，和哈格丁中尉談談。$B$B為了銅鬚的榮耀!', '我們正在奧特蘭克山谷進行一場血腥的戰鬥，野蠻的霜狼氏族在挑戰雷矛的力量!以麥格尼·銅鬚陛下的名義，我們一定要把他們全都消滅掉!佔領那片土地，將敵人趕出去，這對於王國的穩定是非常重要的。$B$B啊，士兵可不是從樹上長出來的!向奧特蘭克的哈格丁中尉報告，在那裡加入雷矛氏族的軍隊，開始履行你光榮的職責吧。', '', '', '', '', '', '', 42488),
(1302, 'zhTW', '[DEPRECATED]James Hyal', '和塞拉摩要塞的書記員倫德瑞談話。', '我的兄弟詹姆士跟隨珍娜女士到塞拉摩去了。我最後一次聽到他的消息是說他們在那兒打完了仗，詹姆士還在那裡的某個地方開了個旅店。不管他現在在哪兒，我想他的生意肯定很熱門，他是個很棒的廚師。$b$b啊，說起來我已經有一陣子沒聽到他的消息了─旅店的生意太忙了─不過塞拉摩的書記員應該可以幫你找到他。書記應該在市中心的要塞...塞拉摩堡壘。', '', '', '', '', '', '', 42488),
(993, 'zhTW', '丟失的主人', '在黑海岸找到沃科爾並且將附魔月虎披風交給他。', '$n，披風做好了。你現在可以去尋找沃科爾，我希望時間還來得及。$B$B披風上的魔法被啟動之後持續不了多久間，也許就只有五分鐘左右的時間。你可以自行決定什麼時候使用它，不過我建議你在找到銳爪以後再用。$B$B如果銳爪告訴我的消息是真的，那麼你應該可以在南邊的某個洞穴中找到他的主人。銳爪會在路邊等你，看見它以後向它揮手打個招呼(使用/wave指令)，然後它就會將它主人所在的位置告訴你。', '', '', '', '', '', '', 42488),
(951, 'zhTW', '瑪塞斯特拉聖物', '收集6個黑暗深淵聖物，把它們交給古樹之林的安努。', '你在主宰之劍找到的那頁書來自於一本古籍...一本精靈撰寫的古籍。但它已經被暮光之錘詛咒和玷污了，看來暮光之錘的信徒是希望用古代精靈的魔法將他們古老的主人重新召回我們的世界。$B$B到東北邊的瑪塞斯特拉廢墟去看看，找到那些古代的聖物。如果我能研究一下它們的話，也許能搞清楚暮光之錘打算如何使用那些精靈的魔法。', '', '', '', '', '', '', 42488),
(731, 'zhTW', '健忘的勘察員', '在勘察員雷姆塔維爾搜尋神秘化石的時候保護他，然後回到奧伯丁的考古學家霍莉那裡。', '好吧，那麼，霍莉...哦，不對，你不是霍莉。霍莉去哪兒啦?$b$b不說這個了，那不是我們要討論的話題。我們必須找到那把石刷...我是說神秘的化石!我們必須找到化石。達納蘇斯的探險者協會希望能看到我的工作進展情況。$b$b如果你準備好了，就和我說一聲，我們去尋找那把刷子...我是說化石!我們要找到一些能讓協會滿意的東西。$b$b你準備好了嗎?', '護送勘察員雷姆塔維爾', '', '', '', '', '', 42488),
(610, 'zhTW', '『漂亮男孩』鄧肯', '從『漂亮男孩』鄧肯那裡奪回凱特琳的匕首。', '我老爸派你來的?我還以為那怪老頭早就已經放棄我了呢。$b$b我之所以離家出走確實不是他的錯，他只是不應該為我安排好一條乏味的人生道路，並希望我欣然接受它。我怎麼能忍受整天讀著那些發黴的書本，整天和那幫灰頭髮加駝背的乏味老頭法師們在一起!$b$b如果你需要我的匕首，你可能得從一個叫『漂亮男孩』鄧肯的血帆海盜那裡奪回來。我想你只要教訓教訓他，他就會屈服的。', '', '', '', '', '', '', 42488),
(479, 'zhTW', '調查安伯米爾', '為瑟伯切爾的暗影牧師奧利斯特搶到8個達拉然墜飾。', '達拉爾正在嘗試著定位出達拉然巫師們施法時的能量流向。現在，我們必須要盡我們一切努力來暫緩他們的進程...$b$b那些咒術師、法師和保衛者恐怕會拼死保護墜飾。你必須清除掉這些阻礙，並把飾物搶到手。$b$b沿著大路向南走，在岔路口轉向東邊就可以到安伯米爾了。', '', '', '', '', '', '', 42488),
(159, 'zhTW', '送交殭屍汁', '把殭屍汁交給烏鴉嶺墓園北方小屋裡的亞伯克隆比。', '這是你要的殭屍汁...$B$B小心一點，這東西強得足以把死人給弄活過來。', '', '', '', '', '', '', 42488);
