UPDATE `quest_template_locale` SET `QuestDescription`='我喝下藥水之後，低語聲就消失了。謝謝你，$p。\n\n不過，一想到恩若司的影響力，就連身在心之室的我都無法倖免於難，真是令人喪氣。如果怒西昂找到一個足以抵抗古神力量的途徑，那我們就可以用它來強化心之室的防禦。\n\n或許母親大人可以從怒西昂的日記搜集更多資訊。', `VerifiedBuild`=42488 WHERE (`ID`=56504 AND `locale`='zhTW');
UPDATE `quest_template_locale` SET `QuestDescription`='<在閃著火花、冒著煙的單位35的殘骸中，你找到了一個小小的黑色立方體。\n\n看樣子是由金屬物質構成的，似乎沒什麼威脅性。\n\n定睛一看，你發現在金屬上刻有一個字詞 - 「咕咕盒」。\n\n這隻奇特的機械鳥禽運作的方式相當怪異。鏽栓應該會有人想要好好地來研究一番。>', `VerifiedBuild`=42488 WHERE (`ID`=56441 AND `locale`='zhTW');
UPDATE `quest_template_locale` SET `QuestDescription`='你會不會好奇我當初是怎麼來到心之室這裡的？\n\n我當然是自願來到這裡的，但過程中有一段時間，好多人都在找尋我。\n\n卡雷苟斯還記得當時的事情。如果你想要知道我那時候如何同時避過代言者和古神的耳目，可以去請他告訴你詳細的經過。', `VerifiedBuild`=42488 WHERE (`locale`='zhTW' AND `ID` IN (56267,56185));
UPDATE `quest_template_locale` SET `QuestDescription`='<這份藥水看來威力強大、無比混沌。它的顏色似乎在不停的變換。\n\n這一定就是怒西昂在日記中提及的混合物。光是站在它旁邊，就讓你的心中浮現一股平靜與清晰感。\n\n或許你沒能找到黑龍王子本人，但或許他為你留下來的東西確實可以協助黯角。>', `VerifiedBuild`=42488 WHERE (`ID`=56190 AND `locale`='zhTW');
UPDATE `quest_template_locale` SET `QuestDescription`='<看來這裡剛剛歷經一場打鬥。恩若司的密探一定已經進入卡拉贊下方的地下墓穴了。\n\n死掉的偵察者身上還有一組鑰匙。或許可以打開門上的鎖。\n\n如果運氣夠好的話，你可以趕在恩若司的密探之前找到怒西昂，並取得一些能夠協助黯角的東西。>', `VerifiedBuild`=42488 WHERE (`ID`=56189 AND `locale`='zhTW');
UPDATE `quest_template_locale` SET `QuestDescription`='很顯然，黑龍王子不在這裡。想找到他，簡直像大海裡撈針。\n\n如果我是你的話，我會去黑石山轉轉。在山壁上有一個削出來的平台，奈法利安以前把那個地方當做巢穴。\n\n怒西昂一直在監視那個地方。就算他本人不在那邊，那裡或許也有人知道該去哪邊探尋他的下落。\n\n另外，$c…顯然你不是唯一在找他的人。最好時時小心身後。', `VerifiedBuild`=42488 WHERE (`ID`=56187 AND `locale`='zhTW');
UPDATE `quest_template_locale` SET `QuestDescription`='黯角沒辦法撐那麼久。過去腐化黑龍軍團的黑暗力量，企圖再次襲捲全世界。\n\n我們必須找到反制的方式。雖然我不是很想提到他，但我知道有個人一直在研究古神，他比任何人都清楚如何對抗他們的邪惡力量。就是怒西昂。\n\n在潘達利亞還有黑龍王子的夥伴，待在朦朧天梯的霧隱客棧。我建議你從那邊著手。\n\n請動作快點，$p。', `VerifiedBuild`=42488 WHERE (`ID`=56186 AND `locale`='zhTW');
UPDATE `quest_template_locale` SET `QuestDescription`='看啊，傳說中的帕斯卡鏽栓工坊 - 我的工坊！\n\n無數發明就在這個地方化為現實，包括我最棒的發明，帕斯卡K1N6型！\n\n帕斯卡K1N6型能造出任何東西…只要你手上有藍圖。\n\n托你的福，才能讓K1N6型平安的回到鏽栓，你想不想知道如何存取他的藍圖資料庫？', `VerifiedBuild`=42488 WHERE (`ID`=55101 AND `locale`='zhTW');
UPDATE `quest_template_locale` SET `QuestDescription`='黑海岸又再度回到我們手裡，你的貢獻影響重大，感謝你的辛勞付出。雖然我不認同泰蘭妲的做法，但若是沒有她，我們恐怕也難以獲勝。\n\n無落如何，她依然是我們的領袖，而且更是黑夜戰士的化身。\n\n她的演說要開始了。你可以站在我旁邊一起聆聽。', `VerifiedBuild`=42488 WHERE (`ID`=54006 AND `locale`='zhTW');
UPDATE `quest_template_locale` SET `QuestDescription`='$n，\n\n我需要你的協助。\n\n瑪翼夫和珊蒂斯正在前往暴風城的路上，懇請烏瑞恩國王發兵協助我們奪回黑海岸。\n\n在過去的日子裡，你己經向我的人民證明你是個忠誠盟友。我希望你能與他們一道進宮，共同遊說國王。\n\n我想我們應該很快就會再度見面。\n\n- 泰蘭妲', `VerifiedBuild`=42488 WHERE (`ID`=53847 AND `locale`='zhTW');
UPDATE `quest_template_locale` SET `LogTitle`='《埃雷達斯的紫色山丘》', `LogDescription`='集齊《埃雷達斯的紫色山丘》的殘篇，組合成一本書。完成之後，將書交給布萊恩。', `VerifiedBuild`=42488 WHERE (`ID`=41168 AND `locale`='zhTW');
UPDATE `quest_template_locale` SET `QuestDescription`='天驕寶庫裡頭存放著幾件雷神最險惡的武器，同時也是雷神最珍貴的寶物 - 這兩種東西往往是一樣的，真是不意外。$B$B其中一件名叫風暴頸飾的護符是能夠駕馭雷電的神器。$B$B闖入寶庫殺死裡頭的管庫，拿走他的鑰匙並從寶庫後面的貯藏箱裡取出護符。', `VerifiedBuild`=42488 WHERE (`ID`=32608 AND `locale`='zhTW');
UPDATE `quest_template_locale` SET `QuestDescription`='你見過哥布林嗎，$n？他們是卑鄙的小怪物，最喜歡的兩樣東西是黃金和他們自己。$B$B黑石獸人取得了哥布林暗殺者的援助，派他們來殺死我們的士兵。如果你到北邊的原野上尋找，就能在草叢間看到他們潛行的輪廓。$B$B我要你過去那裡殺死你所見到的每一個哥布林。必須讓他們知道：沒有人可以招惹聯盟！', `VerifiedBuild`=42488 WHERE (`locale`='zhTW' AND `ID` IN (31144,29081,28797,28796,28795,28794,28793,28792,28791));
UPDATE `quest_template_locale` SET `LogTitle`='幸運的牛蹄', `VerifiedBuild`=42488 WHERE (`ID`=30605 AND `locale`='zhTW');
UPDATE `quest_template_locale` SET `LogDescription`='你可以將貨箱帶回奧格瑪力量谷裡的破齒旅店給伊嘉‧古德溫。$B$B或者，$B$B將貨箱交給奧格瑪榮譽谷裡的蠍尾獅之尾給德利安‧日蔭。', `QuestDescription`='你終於找到伊嘉‧古德溫派你來取的貨箱了。然而，看來那名聖匣守護者代表關於貨箱內容物的警告是正確的。$B$B你的雇主顯然對你謊報了這件工作的危險程度。你真的想把貨箱交給他嗎，或者你願意將它交給主張把箱內物品封鎖起來的德利安‧日蔭?', `VerifiedBuild`=42488 WHERE (`ID`=29428 AND `locale`='zhTW');
UPDATE `quest_template_locale` SET `LogDescription`='將填滿的容器帶去達納蘇斯給泰蘭妲‧語風。', `QuestDescription`='不可否認的，認識你真的很榮幸。你真是你民族裡的高尚典範。$B$B現在去將最後的任務完成吧。將這些水帶去達納蘇斯給泰蘭妲‧語風。', `VerifiedBuild`=42488 WHERE (`ID`=14039 AND `locale`='zhTW');
UPDATE `quest_template_locale` SET `LogDescription`='將『榮譽釀酒者』手印交給德瑞茲‧迅跌，他就在杜洛塔的啤酒節營地入口附近。', `QuestDescription`='假如你給山羊競速學徒，德瑞茲‧迅跌看這個手印的話，他就會讓你購買啤酒節騎乘用山羊。', `VerifiedBuild`=42488 WHERE (`ID`=11419 AND `locale`='zhTW');
UPDATE `quest_template_locale` SET `LogTitle`='The Great Ezra Grimm', `LogDescription`='Find Ezra Grimm\'s smoke shop in Stratholme and recover a box of Grimm\'s Premium Tobacco. Return to Smokey LaRue when the job is done.', `QuestDescription`='Terrible thing... what happened to Ezra. You see, the town was sacked and Ezra didn\'t want to leave his precious goods behind. The last thing I remember him saying was, \'I\'ll burn every last leaf before they get their damned, dirty hands on them!\'$B$BI may love a good stogie but I\'m no fool. I left Ezra and his delightful store that day. I assume he went down in flames but if there\'s a chance that even one box of his famous tobacco is still intact...$B$BWhat do you say, $n? Find a box for ol\' Smokey?', `VerifiedBuild`=42488 WHERE (`ID`=5214 AND `locale`='zhTW');

